import Mousetrap from 'mousetrap';
import { message } from 'antd';
import { VideoTracking } from './index';
import store from './store/RootStore';
import i18n from './locales';
import { ReviewMode } from './types';
import { TOOL_MODE } from '../../utils/tool-mode';

Mousetrap.addKeycodes({
  188: 'comma',
  190: 'period',
  191: 'slash',
});

export default function bindKeyboardEvents(ctx: VideoTracking) {
  // default keyboard events
  Mousetrap.bind('comma', () => {
    if (!store.config.isAnyModalOpened) {
      store.frame.prev(1);
    }
    return false;
  });
  Mousetrap.bind('period', () => {
    if (!store.config.isAnyModalOpened) {
      store.frame.next(1);
    }
    return false;
  });
  Mousetrap.bind('shift+comma', () => {
    if (!store.config.isAnyModalOpened) {
      store.frame.prev(10);
    }
    return false;
  });
  Mousetrap.bind('shift+period', () => {
    if (!store.config.isAnyModalOpened) {
      store.frame.next(10);
    }
    return false;
  });
  Mousetrap.bind('slash', () => {
    if (!store.config.isAnyModalOpened) {
      store.frame.togglePlaying();
    }
    return false;
  });
  Mousetrap.bind('space', () => {
    if (!store.frame.loading && !store.shape.projecting && !store.config.isAnyModalOpened) {
      store.toggleAddMode();
    }
    return false;
  });
  Mousetrap.bind('tab', () => {
    if (!store.frame.loading && !store.shape.projecting && !store.config.isAnyModalOpened) {
      store.instance.selectInstance(null);
    }
    return false;
  });
  Mousetrap.bind(['del', 'backspace'], () => {
    store.delete();
    return false;
  });
  Mousetrap.bind(['ctrl+s', 'command+s'], () => {
    ctx.save();
    return false;
  });
  Mousetrap.bind(['ctrl+z', 'command+z'], () => {
    store.undo.undo();
    return false;
  });
  Mousetrap.bind(['ctrl+y', 'command+y'], () => {
    store.undo.redo();
    return false;
  });
  Mousetrap.bind(['ctrl+c', 'command+c'], () => {
    store.copy();
    return false;
  });
  Mousetrap.bind(['ctrl+v', 'command+v'], () => {
    store.paste();
    return false;
  });
  Mousetrap.bind('alt+d', () => {
    const { selectedInstanceItems } = store.instance;
    if (selectedInstanceItems.length === 1) {
      store.addToCurrentFrame(selectedInstanceItems[0]);
    }
    return false;
  });
  Mousetrap.bind('alt+shift+d', () => {
    const { selectedInstances } = store.instance;
    if (selectedInstances.length === 1) {
      store.addToCurrentFrameByInstance(selectedInstances[0]);
    }
    return false;
  });
  Mousetrap.bind('shift+c', () => {
    if (store.jobProxy?.toolMode === TOOL_MODE.QA_RW) {
      store.config.setReviewMode(store.config.reviewMode === ReviewMode.LABELING ? ReviewMode.REVIEW : ReviewMode.LABELING);
    }
    return false;
  });
  Mousetrap.bind('shift+l', () => {
    store.config.setCrossLineVisible(!store.config.crossLineVisible);
    return false;
  });
  Mousetrap.bind('shift+z', () => {
    if (!store.config.addMode) {
      store.config.setHideAll(!store.config.hideAll);
    }
    return false;
  });
  Mousetrap.bind('alt+t', () => {
    if (store.config.autoOCR) {
      store.config.OCRSyncOn = !store.config.OCRSyncOn;
      message.success(i18n.translate(store.config.OCRSyncOn ? 'OCR_ENABLED' : 'OCR_DISABLED'));
    }
    return false;
  });
  Mousetrap.bind('o', () => {
    store.openAttributesModal();
    return false;
  });
  Mousetrap.bind('f', () => {
    store.shape.fitProjectShapesForSelectedShapes();
    return false;
  });
  Mousetrap.bind(['1', '2', '3', '4', '5', '6', '7', '8', '9', '0'], (e) => {
    const num = Number(e.key);
    if (!Number.isNaN(num)) {
      store.activateTool(num);
    }
    return false;
  });
  Mousetrap.bind('s', () => {
    store.shape.subtractPolygon();
  });
  Mousetrap.bind('m', () => {
    store.shape.mergePolygon();
  });
  Mousetrap.bind('p', () => {
    store.shape.projectSelectedShape();
  });
  Mousetrap.bind('alt+p', () => {
    store.convertShapeToPolygon();
    return false;
  });
  Mousetrap.bind('up', () => {
    store.moveFront();
    return false;
  });
  Mousetrap.bind('shift+up', () => {
    store.moveFront(true);
    return false;
  });
  Mousetrap.bind('down', () => {
    store.moveBack();
    return false;
  });
  Mousetrap.bind('shift+down', () => {
    store.moveBack(true);
    return false;
  });
  Mousetrap.bind('t', () => {
    store.shape.updateConfig({ fill: !store.shape.config.fill });
    return false;
  });
  Mousetrap.bind('v', () => {
    store.shape.updateConfig({ toleranceFill: !store.shape.config.toleranceFill });
    return false;
  });
  Mousetrap.bind('c', () => {
    store.shape.togglePolygonCut();
    return false;
  });

  const keyupListener = (e: KeyboardEvent) => {
    if (store.readonly || store.frame.loading || store.shape.projecting || store.config.isAnyModalOpened) {
      return;
    }

    // hotkey events
    if (store.config.hotkeyMap[e.key]) {
      ctx.handleHotkey(e.key);
    }
  };
  window.addEventListener('keyup', keyupListener);

  return () => {
    Mousetrap.unbind('comma');
    Mousetrap.unbind('period');
    Mousetrap.unbind('shift+comma');
    Mousetrap.unbind('shift+period');
    Mousetrap.unbind('slash');
    Mousetrap.unbind('space');
    Mousetrap.unbind('tab');
    Mousetrap.unbind(['del', 'backspace']);
    Mousetrap.unbind(['ctrl+s', 'command+s']);
    Mousetrap.unbind(['ctrl+z', 'command+z']);
    Mousetrap.unbind(['ctrl+y', 'command+y']);
    Mousetrap.unbind(['ctrl+c', 'command+c']);
    Mousetrap.unbind(['ctrl+v', 'command+v']);
    Mousetrap.unbind('alt+d');
    Mousetrap.unbind('alt+shift+d');
    Mousetrap.unbind('alt+ctrl+d');
    Mousetrap.unbind('shift+c');
    Mousetrap.unbind('shift+l');
    Mousetrap.unbind('alt+t');
    Mousetrap.unbind('o');
    Mousetrap.unbind('f');
    Mousetrap.unbind(['1', '2', '3', '4', '5', '6', '7', '8', '9', '0']);
    Mousetrap.unbind('s');
    Mousetrap.unbind('m');
    Mousetrap.unbind('p');
    Mousetrap.unbind('alt+p');
    Mousetrap.unbind('up');
    Mousetrap.unbind('down');
    Mousetrap.unbind('t');
    Mousetrap.unbind('c');
    window.removeEventListener('keyup', keyupListener);
  };
}
